import React from 'react'
import MediaCard from './MediaCard'
import { Box, Grid, Container, Typography } from '@mui/material'

const Projects = () => {

    const projects = [
        {
            title: "Sudoku Board",
            description: "",
        },
        {
            title: "Simulation",
            description: "",
        },
        {
            title: "Path",
            description: "",
        },



    ]

    return (
        <Box component="div" sx={{
            margin: 3
        }}>
            <Typography variant="h4" color="inherit" component="div" sx={{

                margin: 2
            }}>
                Projects
            </Typography>
            <Grid container justify="center" justifyContent="space-between" sx={{
                marginTop: 4
            }}>
                <Grid item xs={3} sm={3}  ml={3}>
                    <MediaCard></MediaCard>
                </Grid>

                <Grid item xs={3} sm={3}>
                    <MediaCard></MediaCard>
                </Grid>
                <Grid item xs={3} sm={3} >
                    <MediaCard></MediaCard>
                </Grid>
                <Grid item xs={3} sm={3} ml={3} mt = {5} >
                    <MediaCard></MediaCard>
                </Grid>



            </Grid>




        </Box>
    )
}

export default Projects
